class htmlImports{constructor(){this.testSupport()}testSupport(){if(!1 in document.createElement("link"))return console.error(new Error("Your browser doesnâ€™t support HTML Imports.")),!1}load(e){return e.map(e=>this.createTag(e))}createTag(e){const t=this.defineTag(e);return t.setAttribute("async","async"),t.onload=e.callbackLoaded,t.onerror=e.callbackError,document.head.appendChild(t),t}defineTag(e){if(RegExp("(.html)$").test(e.path)){const t=document.createElement("link");return t.rel="import",t.href=e.path,t}if(RegExp("(.js)$").test(e.path)){const t=document.createElement("script");return t.type="module",t.src=e.path,t}return console.error(new Error('Is expected an ".html" or ".js" file, you must be check your path definition')),!1}}